import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/MotherboardPage.css'; // Import the CSS file

const motherboardData = [
  { id: '67ff0cf6173e97a1a082e4a3', name: 'ASUS ROG Maximus Z790 Apex', image: 'data:image/jpeg;base64,', slug: 'asus-rog-maximus-z790-apex' },
  { id: '67ff0cf6173e97a1a082e4a4', name: 'GIGABYTE Z790 AORUS MASTER', image: 'data:image/jpeg;base64,', slug: 'gigabyte-z790-aorus-master' },
  { id: '67ff0cf6173e97a1a082e4a5', name: 'MSI MAG X670E TOMAHAWK WIFI', image: 'data:image/jpeg;base64,', slug: 'msi-mag-x670e-tomahawk-wifi' },
  { id: '67ff0cf6173e97a1a082e4a6', name: 'ASRock X670E Taichi', image: 'data:image/jpeg;base64,', slug: 'asrock-x670e-taichi' },
  { id: '67ff0cf6173e97a1a082e4a7', name: 'ASUS ROG STRIX B650E-F GAMING WIFI', image: 'data:image/jpeg;base64,', slug: 'asus-rog-strix-b650e-f-gaming-wifi' },

];

const MotherboardPage = () => {
  return (
    <div className="motherboard-page">
      <h2>Browse Motherboards</h2>
      <div className="motherboard-grid">
        {motherboardData.map((mobo) => (
          <Link to={`/product/${mobo.id}`} key={mobo.id} className="motherboard-card">
            <img src={mobo.image} alt={mobo.name} />
            <h3>{mobo.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default MotherboardPage;
